import React from "react";
import Header from "./Header.js";
import Slider from "react-slick";

function Homepage() {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 1,
        slidesToScroll: 1,
      };
    return(
        <div>
            <Header/>  
            <div>
             Home   
            </div> 
        </div>
    )
}
export default Homepage
